import React, { useState, useEffect } from "react";
import { Navbar, Container, Nav, Card, Row, Col, Image, Button } from "react-bootstrap";

const NavigationBar = () => {
  return (
    <div>
      <Navbar variant="dark">
        <Container>
          <Navbar.Brand as={Link} to="/">
            UASFILM
          </Navbar.Brand>
          <Nav>
            <Link as={Link} to="/add">
              ADD MOVIE
            </Link>
            <Link as={Link} to="/edit">
              Edit MOVIE
            </Link>
            <Nav.Link href="#film">KUMPULAN FILM</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </div>
  );
};
export default NavigationBar;
